import StyledRoom from "./styles/StyledRoom";
import StyledRoomName from "./styles/StyledRoomName";
import Title from "./styles/StyledRoomTitle";
const Room = () => {
  return (
    <StyledRoom>
      <Title>
        <input type="checkbox" />
        <span>
          <StyledRoomName>Room</StyledRoomName>
        </span>
      </Title>
      <Title>
        <div>
          <label htmlFor="adults">Adults:</label>
          <select id="adults">
            <option>1</option>
            <option>2</option>
          </select>
        </div>
        <div>
          <label htmlFor="children">Children:</label>
          <select id="children">
            <option>0</option>
            <option>1</option>
            <option>2</option>
          </select>
        </div>
      </Title>
    </StyledRoom>
  );
};

export default Room;
